创建1个对象，这个对象在内存中是如何分配的

子类对象中有自己的属性和所有父类的属性

代码段中的每1隔类都有1个叫做isa的指针，这个指针指向它的父类

一直指到NSObject


[p1 sayHi];
现根据p1指针找到p1所指向的对象，然后根据这个对象的isa指针找到person类。搜索person类中是否有这个sayHi方法，如果有就执行，如果没有，就根据类的isa指针找到父类...，NSObject中没有就报错。
