chapter1/123001-dian-yu-fa-548c-property.body:
点语法

OC对象如果要为属性赋值或者取值，就要调用相应的getter或者setter方法

点语法在编译器编译的时候会将点语法转换为调用getter和setter方法的代码

当使用点语法赋值的实现就是调用setter

当使用点语法取值的实现就是调用getter




@property只能生成getter和setter的声明，实现还要靠我们自己来，而实现也没什么技术含量，方法的实现代码能不能自动生成？
@synthesize

作用：自动生成getter和setter的实现，必须写在类的实现中
语法：@synthesize property名称

@interface Person:NSObject{

int _age;

}

@property int age;

@end

@implementation Person

@synthesize age;

@end

@synthesize做的事情

@interface Person:NSObject{
    int _age;
}
@property int age;
@end

@implementation Person{
    int age;
}

@synthesize age;

-(void)setAge:(int)age{
    self->age = age;
}
@end

a、生成1个真私有的属性，属性的类型和@synthesize对应的@property类型一致。属性的名字和@synthesize对应的@property名字一致
b、自动生成setter方法的实现

实现的方式：将参数直接赋值给自动生成的私有属性

自动生成getter方法的实现

实现的方式：将生成的私有属性返回


希望@synthesize不去自动生成新的私有属性?直接在getter和setter方法中去操作我们已经写好的属性就可以了

语法：

@synthesize @property名称=已经存在的属性名；

@synthesize age = _age;

1）不会再去生成私有属性

2）、直接生成getter setter的实现





setter的实现：把参数值直接赋值给指定的属性

getter的实现：直接返回指定的属性值

批量声明

如果多个@property的类型一致，可以批量声明

@property float height,weight;


@synthesize的也可以批量声明

@synthesize name = _name,age = _age;






以上都是很早的Xcode版本实现
@property类型属性名

自动生成1个私有属性

自动生成getter和setter的声明

自动生成getter和setter的实现

注意：

可以批量声明相同类的peoperty

@peoperty生成的getter和setter是直接返回的，没有做任何逻辑处理

我们可以重写setter来自定义验证逻辑，如果重写了setter会自动生成getter

如果重写了getter会自动生成setter。如果重写setter和getter会出问题



如果想为类写一个属性，并且为属性封装setter和getter

1个@property属性搞定




继承

父类的@property一样可以被继承

@property生成的属性是私有的，在子类的内部是无法直接访问生成的私有属性（什么叫无法直接访问生成的私有属性，就是self->name）

但是可以通过setter和getter来访问（self.name）

chapter1/133001-jing-tai-lei-xing-he-don.body:
OC是1门弱类型语言

编译器在编译的时候，检查不是很严格。

不管怎么写，检查不是很严格。int num = 12.12;NSString *str = [Pig new]; [str length];

优点：灵活。缺点：太灵活


强类型语言：编译器在编译的时候做语法检查的时候，如果语法不通过编译就报错。

静态类型：1个指针指向的对象是1个本类对象

动态类型：1个指针指向的对象不是本类对象


编译检查

编译器在编译的时候，通过指针调用指针所指向的对象的方法会进行判断

判断原则：通过指针去堆区找指针所指向的对象，再通过对象的isa指针在代码段找类，查看类中是否有方法实现，如果有则通过编译。如果没有则编译失败


注意：编译时期能否通过关键看指针的类型


运行检查

编译检查只是骗过了编译起，但是这个方法能不能真正执行会在运行的时候去对象中是否真的有这个方法，有就执行，没有就报错

LSP

父类指针指向子类对象

实际上任意指针可以指向任意对象，编译器不会报错


#import 
@interface Animal : NSObject
@property NSString *name;
-(void)run;
@end
#import "Animal.h"
@implementation Animal
-(void)run{
NSLog(@"run");
}
@end
#import "Animal.h"
@interface Pig : Animal
-(void)eat;
@end
#import "Pig.h"
@implementation Pig
-(void)eat{
NSLog(@"吃完就死");
}
@end
Pig *pig = [Animal new];
[pig eat];

当1个子类指针指向父类对象的时候，编译器运行子类指针调用子类独有的方法，但是在运行的时候就会报错

chapter1/163001-dong-tai-lei-xing-jian-c.body:
动态类型检查
前言

苹果Xcode的编译器叫做LLVM，可以编译C、C++、OC、Swift代码为二进制代码
编译器在编译的时候可以判断指针是否可以调用指针指向对象的方法。编译的时候判断准则就是指针类型
为了骗过编译器，程序在运行的时候还会做运行检查。运行的时候的判断准则：通过指针所指向的对象里面的isa找到代码段中的类，判断是否有这个方法可以执行
可以写代码先判断一下对象中是否有这个方法再去执行



判断指定对象能否响应指定的方法
BOOL result = [p1 respondsToSelector:@selector(sayHi)];


判断指定的对象是否为指定类的对象或者指定类的子类对象
BOOL b2 = [p1 isKindOfClass:[Person class]];


判断对象是否指定类的对象，不包括子类
BOOL b4 = [st isMemberOfClass:[Person class]];


判断类是否为另一个类的子类
BOOL b5 = [Student isSubclassOfClass:[Person class]];


isSubclassOfClass加上isMememberOfClass等于isKindOfClass

总结：

[指针respondsToSelector：@selector(方法名)]

[对象名respondsToSelector：@selector(方法名)]

用来判断对象能否调用对象方法或者类能否调用类方法。

respondsToSelector：可以跟在对象或者类名后面，分别判断的是对象能否调用该对象方法和该类能否调用该类方法。

instancesRespondToSelector：只能跟在类名后面，但是后面方法可以跟对象方法和类方法，作用是判断该类的对象能否调用该类里面的对象方法


//Person
#import 

@interface Person : NSObject
@property NSString* name;
@property int age;

-(void)sayHi;

@end

#import "Person.h"
@implementation Person

-(void)sayHi{
    NSLog(@"Hi");
}

@end


//Student
#import "Person.h"

@interface Student : Person
-(void)eat;
+(void)study;
@end

#import "Student.h"

@implementation Student
-(void)eat{
    NSLog(@"吃饭");
}

+(void)study{
    NSLog(@"学习");
}
@end



//测试
    Person *p1 = [[Person alloc] init];


    p1.name = @"lbp";
    p1.age = 20;

    //判断p1对象能否响应sayHi方法
    BOOL result = [p1 respondsToSelector:@selector(sayHi)];
    if (result) {
        [p1 sayHi];
    } else {
        NSLog(@"没有sayHi方法");
    }

    //判断指定的对象是否为指定类的对象或者指定类的子类对象
    BOOL b2 = [p1 isKindOfClass:[Person class]];
    NSLog(@"b2:%d",b2); //1


    Student *st = [[Student alloc] init];
     BOOL b3 = [st isKindOfClass:[Person class]];
    NSLog(@"b3:%d",b3); //1


    //判断对象是否指定类的对象，不包括子类
    BOOL b4 = [st isMemberOfClass:[Person class]];
    NSLog(@"b4:%d",b4);//0

   //判断类是否为另一个类的子类
    BOOL b5 = [Student isSubclassOfClass:[Person class]];
    NSLog(@"b5:%d",b5); //1

    //[指针 respondsToSelector：@selector(方法名)]
    //[对象名 respondsToSelector：@selector(方法名)]
    //用来判断对象能否调用对象方法或者类能否调用类方法。


   BOOL b6 = [Student respondsToSelector:@selector(study)];
    NSLog(@"b6:%d",b6);     //1

    BOOL b8 = [Student respondsToSelector:@selector(eat)];
    NSLog(@"b8:%d",b8);   // 0


    BOOL b7 = [st respondsToSelector:@selector(eat)];
   NSLog(@"b7:%d",b7);  //1



    BOOL b9 = [Student instancesRespondToSelector:@selector(study)];
    NSLog(@"b9:%d",b9);  //0

    BOOL b10 = [Student instancesRespondToSelector:@selector(eat)];
    NSLog(@"b10:%d",b10);  //1

chapter1/173001-kan-tou-gou-zao-fang-fa..body:
构造方法

new方法的内部就是先调用alloc方法，再调用init方法

alloc方法：那个类接受alloc消息，那么该方法返回该接受类的对象，并把对象返回

init方法：是1个对象方法，作用：初始化对象



创建对象的步骤：先使用alloc创建1个对象，再使用init初始化这个对象，才可以使用这个对象

使用1个未被初始化的对象是很危险的


init方法：作用：初始化对象，为对象赋初始值，叫做构造方法


重写init构造方法

如果想创建出来的对象的属性值不是默认的初始化值，则需要重写init方法

重写init方法的规范：

必须要先调用父类的init方法（因为当前类初始化就是通过`[父类init]`去初始化），然后将返回值赋值给self

调用init方法有可能会失败，如果失败直接返回nil

判断父类是否初始化成功。如果self != nil，则代表初始化成功

如果初始化成功就去初始化当前对象的属性

最后返回self




解惑：

为什么要调用父类的init方法？
当前类有isa指针，当前类的isa指针赋值是通过父类的init方法赋值的。
需要保证当前对象的父类属性同时被初始化


重写init方法的规范：

-(instancetype)init{
    if (self = [super init]) {
        //todo：自定义属性的初始化
    }
    return self;
}
//Person

#import 

@interface Person : NSObject
@property NSString* name;
@property int age;

-(void)sayHi;

@end

#import "Person.h"
@implementation Person

-(void)sayHi{
    NSLog(@"Hi");
}

-(instancetype)init{
    self = [super init];
    if (self) {
        self.name = @"杭城小刘";
        self.age = 22;
    }
    return self;
}
@end


//测试

 Person *p1 = [[Person alloc] init];    //p1.name = "杭城小刘"，p1.age =22;
 Person *p2 = [Person new];             //p2.name = "杭城小刘"，p2.age =22;
如果2个类的关系为组合关系，且它的一个属性是另一个类的对象，那么当该类初始化的时候默认它的属性为nil，那么如何初始化？
-(instancetype)init{
    self = [super init];
    if (self) {
        self.name = @"lbp";
        self.age = 22;
        self.pig = [[Pig alloc] init];
    }
    return self;
}

//测试
  Person *p1 = [[Person alloc] init];        //p1.dog != nil
自定义构造方法

现状：虽然每次双肩的对象的属性值不是默认的，但是每次初始化的对象的值都是一样的。

需求：每次实例化的对象的属性值由调用者决定

解决办法：自定义构造方法

自定义构造方法规范：

自定义构造方法的返回值为instancetype

方法的命名必须以initWith开头

方法的实现类似init的实现




注意：此时不能使用new来调用。（因为new的实现是先alloc再init，默认init的实现是给属性赋默认值）
-(instancetype)initWithName:(NSString *)name andAge:(int)age{
    if (self = [super init]) {
        self.name = name;
        self.age = age;
    }
    return self;
}
//Person
#import 
@interface Person : NSObject
@property NSString* name;
@property int age;

-(instancetype)initWithName:(NSString *)name andAge:(int)age;
@end

#import "Person.h"
@implementation Person

-(instancetype)init{
    self = [super init];
    if (self) {
        self.name = @"lbp";
        self.age = 22;
    }
    return self;
}

//不能在构造方法之外给self赋值
//编译器认为只有以initWith开头的方法是构造方法

-(instancetype)initWithName:(NSString *)name andAge:(int)age{
    if (self = [super init]) {
        self.name = name;
        self.age = age;
    }
    return self;
}

@end


//测试

Person *p1 = [[Person alloc] init];
Person *p2 = [Person new];    
Person *p3 = [[Person alloc] initWithName:@"杭城小刘2号" andAge:23];


关于“自定义构造方法必须以initWith开头”做个实验

报错信息很明显：不能在构造方法之外给self赋值
因为，编译器认为只有以initWith开头的方法是构造方法

chapter1/19setter.html.body:
MRC模式下的Setter方法
完美setter方法：判断新旧对象是否是同一个对象，如果是同一个则什么都不做。
只有新旧对象不是同一个对象的时候，才release旧对象retain新对象
同时在对象dealloc的时候也要将属性release掉
-(void)setAAA:(AAA *)aaa{
    if(_aaa != aaa){
        [_aaa release];
        _aaa = [aaa retain];
    }
}


-(void)dealloc{
    [_aaa release];
    [super dealloc];
}

chapter1/20class4e0e23-import-de-qu-bie..body:
@class #import

使用场景：当2个类互相包含的时候，当Person.h中包含Car.h，而Car.h包含Person.h的时候，就会出现循环引用的问题，就会造成无限递归的问题，从而导致无法编译通过
解决方案：向任一一个类中不要使用#import方法引入对方的头文件。而是使用@class 类名; 的方式来标注这个是类，这样子就可以在不引入对方头文件的情况下告诉编译器这个是类

@class与#import的区别

#import是将指定的文件内容拷贝到写指令的地方

@class并不会拷贝任何内容，只是告诉编译器这个1个类，这样编译器在编译的时候才知道这个是1个类

