func evaluat(expression:ArithmeticExpression)->Int{
 switch expression {
 case let .Number(value):
 return value
 case let .Addition(left,right):
 return evaluat(expression: left)+evaluat(expression: right)
 case let .Multiplication(left,right):
 return evaluat(expression: left)*evaluat(expression: right)
 }
